-- ----------------------------
-- Table structure for t_app_user
-- ----------------------------
DROP TABLE IF EXISTS `t_app_user`;
CREATE TABLE `t_app_user`  (
  `user_id` bigint(20) UNSIGNED NOT NULL COMMENT '用户业务user id',
  `user_mobile` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `user_email` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `user_password` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `user_kind` char(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '类型（是否是HPC03用户）',
  `user_status` tinyint(1) UNSIGNED NULL DEFAULT 0 COMMENT '状态（0：离线，1：在线）',
  `first_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `last_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `user_logintime` datetime(0) NULL DEFAULT NULL COMMENT '登录时间',
  `cloud_random` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '云端随机数',
  `random_expiry_time` datetime(0) NULL DEFAULT NULL COMMENT 'cloud random过期时间',
  `notification` enum('true','false') CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT 'true' COMMENT '通知使能（true:允许，false:不允许）',
  `system` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '手机系统',
  `push_token` varchar(225) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '手机推送认证',
  `user_time_zone` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户的时区，格式为： +08:00',
  `user_random` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户随机数',
  `active_status` tinyint(1) NULL DEFAULT 0 COMMENT '用户邮箱激活状态，0：没有激活，1：已被激活',
  `active_link_mail_time` bigint(20) NULL DEFAULT NULL COMMENT '激活链接产生时间',
  `reset_pwd_mail_time` bigint(20) NULL DEFAULT NULL COMMENT '重置密码链接产生时间',
  `reset_pwd_cnt` int(11) NULL DEFAULT NULL COMMENT '重置密码的次数',
  `create_date` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `l_upd_date` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`user_id`) USING BTREE,
  UNIQUE INDEX `user_id`(`user_id`) USING BTREE,
  UNIQUE INDEX `email_idx`(`user_email`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户信息表' ROW_FORMAT = Compact;

